@SkogmanThomas @pere43698233 @Snyggois Project veritas har video bevis på storskaligt valfusk.
Det finns ju också ballot harvesting.
Först skickar Democrats ut ballots till alla även om dom inte vill ha. Sen kommer deras valarbetare och erbjuder hjälp att fylla i valsedeln och ta den till vallokalen.

@greg_dred @ImNotHer71 @illdiscourse Ballot Harvesting that Republicans refuse to do.
Most people don't care about policies and will sell their vote on an absentee ballot for a phone card or BBQ dinner. 
You just have to be slick about it.
